import { InMemoryDbService } from 'angular-in-memory-web-api';
import { Injectable } from '@angular/core';

@Injectable({ providedIn: 'root' })
export class InMemoryDataService implements InMemoryDbService {
  createDb() {
    const products = [
      { id: 1, title: 'Apple', category: 'groceries', price: 2 },
      { id: 2, title: 'Shampoo', category: 'beauty', price: 12 },
      { id: 3, title: 'Bread', category: 'groceries', price: 3 },
      { id: 4, title: 'Face Cream', category: 'beauty', price: 20 }
    ];
    return { products };
  }
}
